const Item = () => {


    let i = item.map((item) =>{
    
        return (
            
       
       <div className='items_blok' >
       <div>{item.name}</div>
       
       </div>
       
        )
    })
    return (
        <div>
           <div>
            {i}
           </div>
        </div>
    );
};

export default Item;
